import React, { useState, createContext } from "react";

export const AuthProtect = createContext();

export const AuthProtectProvider = (props) => {
  const [authProtected, setAuthprotected] = useState(true);

  return (
    <AuthProtect.Provider value={(authProtected, setAuthprotected)}>
      {props.children}
    </AuthProtect.Provider>
  );
};
